Risks Related to Data Privacy and Data Security
Actual or perceived security vulnerabilities in our services or any breaches of our security controls and unauthorized access to our or a customer’s data could harm our business and operating results. The services we offer involve the storage of large amounts of our and our customers’ sensitive and proprietary information, some of which may be considered personally identifiable. Cyberattacks and other malicious internet-based activity, including ransomware, malware and viruses, continue to increase in frequency and magnitude and we face security threats from malicious third parties that could obtain unauthorized access to, or disrupt, our systems, infrastructure and networks. These threats may come from a variety of sources including nation-state sponsored espionage and hacking activities, industrial espionage, organized crime, sophisticated organizations, hacking groups and individuals and insider threats. These sources can also implement social engineering techniques, such as “phishing,” “smishing” or “vishing” attacks, to induce our partners, users, employees or customers to disclose passwords or other sensitive information or take other actions to gain access to our data or our users’ data. Hackers that acquire user account information at other companies can attempt to use that information to compromise the accounts of our personnel, or our users’ accounts if an account shares the same sensitive information such as passwords. As we increase our customer base, our brand becomes more widely known and recognized, and our service is used in more heavily regulated industries where there may be a greater concentration of sensitive and protected data, such as healthcare, government, life sciences, and financial services, we have become more of a target for these malicious third parties.

•we do not currently provide support for software applications developed by our partner ecosystem, and users may be left without support and potentially cease using our services if these system integrators and developers do not provide adequate support for their applications;
•we cannot provide any assurance that we will be able to successfully integrate our services with our partners’ products or that our partners will continue to provide us the right to do so; and
•these system integrators, partners and developers may not possess the appropriate intellectual property rights to develop and share their applications. In addition, our competitors may be effective in providing incentives to third parties to favor their products or services, or to prevent or reduce subscriptions to our services. In some cases, we also compete directly with our partners’ product offerings, and if these partners stop reselling or endorsing our services or impede our ability to integrate our services with their products, our business and operating results could be adversely affected. Moreover, competitor acquisitions of our partners could result in a decrease in the number of current and potential customers, as our partners may no longer facilitate the adoption of our services by potential customers.

•diversion of management time and focus from operating our business to addressing acquisition integration challenges;
•coordination of research and development and sales and marketing functions;
•retention of key employees from the acquired company;
•cultural challenges associated with integrating employees from the acquired company into our organization;
•integration of the acquired company’s technology and products into our business, particularly if the acquired company’s software and services are not easily adapted to work with our products;
•integration of the acquired company’s accounting, management information, human resources and other administrative systems, as well as the acquired operations, and any unanticipated expenses related to such integration;
•the need to implement or improve controls, procedures, and policies at a business that prior to the acquisition may have lacked effective controls, procedures and policies;
•liability for activities of the acquired company before the acquisition, including intellectual property infringement claims, violations of laws, commercial disputes, tax liabilities and other known and unknown liabilities;
•completing the transaction and achieving the anticipated benefits of the acquisition within the expected timeframe or at all;
•unanticipated write-offs, expenses, charges or risks associated with the transaction;
•litigation or other claims in connection with the acquired company, including claims from terminated employees, customers, former stockholders or other third parties, which may differ from or be more significant than the risks our business faces; and
•acquisitions could result in dilutive issuances of equity securities or the incurrence of debt.
34 Our failure to address these risks or other problems encountered in connection with our past or future acquisitions and investments could cause us to fail to realize the anticipated benefits of these acquisitions or investments, cause us to incur unanticipated liabilities, and harm our business generally. Future acquisitions could also result in dilutive issuances of our equity securities, the incurrence of debt, contingent liabilities, amortization expenses, incremental operating expenses or the write-off of goodwill, any of which could harm our financial condition or operating results.

•authorizing a classified board of directors whose members serve staggered three-year terms;
•authorizing “blank check” preferred stock, which could be issued by our Board of Directors without stockholder approval and may contain voting, liquidation, dividend and other rights superior to our Class A common stock;
•limiting the liability of, and providing indemnification to, our directors and officers;
•limiting the ability of our stockholders to call and bring business before special meetings;
•requiring advance notice of stockholder proposals for business to be conducted at meetings of our stockholders and for nominations of candidates for election to our Board of Directors; and
•controlling the procedures for the conduct and scheduling of board directors and stockholder meetings.
These provisions, alone or together, could delay or prevent hostile takeovers and changes in control or changes in our management. As a Delaware corporation, we are also subject to provisions of Delaware law, including Section 203 of the Delaware General Corporation Law, which prevents certain stockholders holding more than 15% of the voting power of our outstanding capital stock from engaging in certain business combinations without approval of the holders of at least two-thirds of the voting power of our outstanding capital stock not held by such stockholder.

•price and volume fluctuations in the overall stock market from time to time;
